import ExpenseItem from "./ExpenseItem";

function Expences(props) {
  return (
    <div>
      <ExpenseItem
        title={props.data.expences[0].title}
        date={props.data.expences[0].date}
        price={props.data.expences[0].price}
      />
      <ExpenseItem
        title={props.data.expences[1].title}
        date={props.data.expences[1].date}
        price={props.data.expences[1].price}
      />
      <ExpenseItem
        title={props.data.expences[2].title}
        date={props.data.expences[2].date}
        price={props.data.expences[2].price}
      />
      <ExpenseItem
        title={props.data.expences[3].title}
        date={props.data.expences[3].date}
        price={props.data.expences[3].price}
      />
    </div>
  );
}

export default Expences;
